in_source: |-
  int a = 1;
  int b = 1;
  int sum = 0;
  int c =0;

  while (b<4000000) {
     if (b%2==0) {
       sum = sum + b;
     }
     c = a +b;
     a = b;
     b = c;
  }
  print(sum);
